import React from 'react'
import { GetUsers } from '../DataCollection/Request'
import { useEffect, useState } from 'react';

export const RenderMeeting = (props) => {
    console.log('Test before');
    (async () => await gather(0.3))();
    console.log('Test between');
    (async () => await gather(0.7))();
    console.log('Test after');
  

  return(
    <>
      <h1>hej</h1>
    </>
  )
}

async function gather(w){
  if(w<0.5) await sleep(5000);
  else console.log('No sleep');
  console.log(`printing ${w}`)
}

function sleep(ms) {
  return new Promise(resolve => setTimeout(resolve, ms));
}
